import './App.css';
import Header from './organisms/header/header.js';
import Navbar from './organisms/Navbar/Navbar.js';
import Footer from './organisms/footer/Footer.js';
import {Listing} from './organisms/isting';

function App() {
  return (
    <div className="App">
      <Header/>
      <Navbar/>
     <Listing/>
     <Footer/>
    </div>
  );
}

export default App;
